import createReactComponent from "../createReactComponent";
import defaultAttributes from "../defaultAttributes";
var DivideSquare = createReactComponent("DivideSquare", ["svg", defaultAttributes, [["rect", {
  x: "3",
  y: "3",
  width: "18",
  height: "18",
  rx: "2",
  ry: "2",
  key: "1sylwi"
}], ["line", {
  x1: "8",
  y1: "12",
  x2: "16",
  y2: "12",
  key: "6hnc9b"
}], ["line", {
  x1: "12",
  y1: "16",
  x2: "12",
  y2: "16",
  key: "1f7hkw"
}], ["line", {
  x1: "12",
  y1: "8",
  x2: "12",
  y2: "8",
  key: "1tsolw"
}]]]);
export default DivideSquare;
